#!/bin/bash

# This script wraps the solo jvm 
# and performs the task of daemonizing the jvm.
# It DOES NOT drop privlages (it has to be run as the same
# user which the solo server is suposed to run as.
# There are no user facing arguments.

if [ -f /etc/local/collection/scheduler.conf ];
then
  source /etc/local/collection/scheduler.conf
else
  echo "No config file !!!!!!"
  exit 666
fi

SCHEDULER_RMI_PORT=44300
SCHEDULER_JMX_PORT=33300
SCHEDULER_YOURKIT_PORT=55300

BASE_DIR="/opt/collection"
LOG_OUTPUT=scheduler
LOG_PATH=$BASE_DIR/log/$LOG_OUTPUT

if [ "$1" = "detached" ] ; then

        LIB_DIR=$BASE_DIR/lib
        RCS_DIR="$BASE_DIR/resources"
        CONF_DIR="$BASE_DIR/resources/conf"
        CP="$BASE_DIR/classes:$(echo $LIB_DIR/python/*.jar | sed 's/ /:/g'):$(echo $LIB_DIR/python/thirdparty/*.jar | sed 's/ /:/g')"
        JMX_OPT="-Dcom.sun.management.jmxremote.port=$SCHEDULER_JMX_PORT -Dcom.sun.management.jmxremote.authenticate=false -Dcom.sun.management.jmxremote.ssl=false"
        LOG4J_OPT="-Dlog4j.configuration=$RCS_DIR/log4j2_scheduler.xml -Dlog4j.kapow.configuration=$RCS_DIR/log4j_scheduler.properties -Dlog4j.outputfolder=$LOG_OUTPUT"
        NETGATE_OPT="-Dpageonce.module.name=scheduler -DServerLocalPort=$SCHEDULER_RMI_PORT -DnetgateConfPath=$CONF_DIR/general.properties -DresourcesPath=$RCS_DIR"
        YJP_OPT="-agentpath:$RCS_DIR/bin/libyjpagent-linux-x86-64.so=port=$SCHEDULER_YOURKIT_PORT,dir=$BASE_DIR/yourkit/scheduler,disableexceptiontelemetry,disablestacktelemetry"
        JVM_MEMORY_OPT="-Xmx${SCHEDULER_MAX_MEM} -Xms${SCHEDULER_MAX_MEM} -XX:PermSize=${SCHEDULER_PERMSIZE} -XX:MaxPermSize=${SCHEDULER_PERMSIZE} -XX:+HeapDumpOnOutOfMemoryError -XX:HeapDumpPath=/tmp/"
        MAIN_CLASS=com.netgate.server.python.scheduler.PythonScheduler
        JVM_EXECUTABLE="${JVM_EXECUTABLE:-/usr/bin/java}"

        cd $BASE_DIR
        exec $JVM_EXECUTABLE -server $JVM_MEMORY_OPT $JMX_OPT $LOG4J_OPT $NETGATE_OPT -cp $CP $MAIN_CLASS
fi

STDOUT_FILE=$LOG_PATH/scheduler.system.output.log

# Redirect all standard FD's to /dev/null
exec < /dev/null
exec >> $STDOUT_FILE
exec 2>&1

# clear umask
umask 0000

# Anything else here(ulimit, PATH...)

# This needed to make setsid work properly (don't even ask!)
set -m
# call ourselvs with the the 'detached' argument
# NEVER call this script like this directly, this is an internal mechanism
/usr/bin/setsid "$0" detached

exit 0
